/*Table structure for table `site_items` */

CREATE TABLE `site_items` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `unicode` varchar(100) DEFAULT NULL COMMENT 'уник.код',
  `header` varchar(255) NOT NULL,
  `artikul` varchar(255) DEFAULT NULL,
  `visible` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `order` int(10) unsigned NOT NULL DEFAULT '999',
  `catid` int(10) unsigned DEFAULT NULL,
  `image` varchar(255) DEFAULT NULL COMMENT 'изображение малое',
  `imagebig` varchar(255) DEFAULT NULL COMMENT 'изображение большое',
  `upper_text` varchar(255) DEFAULT NULL,
  `uri` varchar(100) NOT NULL,
  `text` text,
  `shorttext` text,
  `meta_kw` text,
  `meta_descr` text,
  `html_title` varchar(500) DEFAULT NULL,
  `height` mediumint(3) unsigned DEFAULT NULL,
  `worktime` mediumint(3) unsigned DEFAULT NULL COMMENT 'время работы',
  `caliber` mediumint(3) unsigned DEFAULT NULL COMMENT 'калибр',
  `zalps` mediumint(3) unsigned DEFAULT NULL COMMENT 'кол-во залпов',
  `price` int(10) unsigned DEFAULT NULL COMMENT 'новая цена',
  `oldprice` int(10) unsigned DEFAULT NULL COMMENT 'старая цена',
  `newprice` int(10) unsigned DEFAULT NULL COMMENT 'не используется?',
  `promo_price` int(10) unsigned DEFAULT NULL COMMENT 'цена по промо-коду',
  `dimensions` varchar(30) DEFAULT NULL,
  `ishit` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'хит?',
  `isbonus` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'бонус?',
  `isrecommended` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'рекомендовано?',
  `showonindex` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT 'выводить на главной?',
  `videocode` text COMMENT 'код для видео',
  `videocode2` text COMMENT 'embed для видео',
  `rating` decimal(3,2) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `uri` (`uri`),
  UNIQUE KEY `unicode` (`unicode`),
  KEY `catid_order_visible` (`catid`,`order`,`visible`),
  KEY `showonindex_visible` (`showonindex`,`visible`),
  KEY `uri_visible` (`uri`,`visible`),
  CONSTRAINT `site_items_ibfk_1` FOREIGN KEY (`catid`) REFERENCES `site_categories` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8;

