insert  into `site_pages`(`id`,`uri`,`header`,`text`,`visible`,`update_time`,`order`,`pid`,`meta_kw`,`meta_descr`,`html_title`,`upper_text`) values (66,'index','Главная','',1,'2019-11-18 15:38:16',999,0,'','Магазин фейерверков. Купить салюты фейерверки в Минске. Предлагаем купить классный фейерверк или салют с доставкой по Минску и Беларуси! Недорогая и сертифицированная пиротехника.','Салют фейерверк купить в Минске minskfireworks.by','<h1>\r\n	Предлагаем купить качественные фейерверки и салюты в Минске недорого с бесплатной доставкой!</h1>\r\n<div>\r\n	&nbsp; Уже давно на любой большой праздник принято покупать салют или фейерверк, ведь торжественное мероприятие нужно закончить ярко, и именно пиротехника позволяет сделать это красиво, громко и весело, гости будут в восторге от фейерверков которые вы купите у нас в магазине! Мы предлагаем все виды праздничной пиротехники - начиная от тортовых свечей и фонтанов и заканчивая большими и очень большими батареями салютов! Вы обязательно подберёте у нас фейерверк который подойдёт и по цене и по времени работы или количеству залпов - ведь в продаже постоянно присутствует около 100 позиций праздничной пиротехники по цене от 2 белорусских рублей!</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	&nbsp;Мы предлагаем бесплатно доставить ваш заказ по территории г. Минска при сумме заказа от 30 рублей, по территории Минской области при сумме заказа от 50 рублей и по всей Беларуси (список всех городов куда осуществляется доставка уточняйте по телефонам) при сумме заказа всего от 100 рублей! Вся продукция которая представлена у нас на сайте и в магазине сертифицирована, легально ввезена на территорию Беларуси, качественная, стоит недорого - низкая цена при высоком качестве, и самое главное - очень и очень красивая! Вы останетесь довольны! Звоните!</div>\r\n<ul class=\"content-menu\">\r\n	<li>\r\n		<a href=\"/category/malye\" title=\"МАЛЫЕ\"> <img alt=\"фейерверки в минске малые батареи салютов\" src=\"http://fireworks.by/i/batarei-salyutov-malye.jpg\" style=\"margin: 5px 0 5px 0\" /> </a></li>\r\n	<li>\r\n		<a href=\"/category/srednie\" title=\"СРЕДНИЕ\"> <img alt=\"купить фейерверк средние батареи салютов\" src=\"http://fireworks.by/i/batarei-salyutov-srednie.jpg\" style=\"margin: 5px 0 5px 0\" /> </a></li>\r\n	<li>\r\n		<a href=\"/category/bolshie\" title=\"БОЛЬШИЕ\"> <img alt=\"большие батареи салютов\" src=\"http://fireworks.by/i/batarei-salyutov-bolshie.jpg\" style=\"margin: 5px 0 5px 0\" /> </a></li>\r\n	<li>\r\n		<a href=\"/category/super\" title=\"СУПЕР\"> <img alt=\"салют фейерверк купить в минске - суперфейерверки\" src=\"http://fireworks.by/i/super-batarei-salyutov.jpg\" style=\"margin: 5px 0 5px 0\" /> </a></li>\r\n	<li>\r\n		<a href=\"/category/fontany\" title=\"ФОНТАНЫ\"> <img alt=\"Наземные фейерверки - вулканы купить в Минске\" src=\"http://fireworks.by/i/fontany.jpg\" style=\"margin: 5px 0 5px 0\" /> </a></li>\r\n	<li>\r\n		<a href=\"/category/rakety\" title=\"РАКЕТЫ\"> <img alt=\"самые популярные фейерверки у детей - салют в виде ракеты купить в минске\" src=\"http://fireworks.by/i/rakety.jpg\" style=\"margin: 5px 0 5px 0\" /></a></li>\r\n</ul>\r\n'),(90,'skidki','Скидки','<h1>\r\n	Фейерверки со скидкой</h1>\r\n',1,'2019-11-21 14:16:21',6,66,'','','Фейерверки со скидкой купить в магазине piro.by','<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n'),(71,'pay','Оплата','<div style=\"font-size:13px; padding:20px 20px 20px 20px; line-height:21px;\">\r\n	<p>\r\n		Оплата фейерверков возможна наличными в магазине и по безналичному расчёту.</p>\r\n	<p>\r\n		<span style=\"color: rgb(255, 0, 0);\">Внимание!</span> Мы не продаём пиротехнику через интернет по образцам!</p>\r\n	<p>\r\n		Корзина на сайте служит для предварительного бронирования товаров! Все товары нужно забирть у нас в магазине или воспользоваться нашей помощью по организции доставки вашими собственными силами!</p>\r\n	<p>\r\n		Все вопросы по телефонам! Заказы принимются только по телефонам, без нарушений ус