an\', times, serif; font-size: 16px;\">скидка 15%&nbsp;</b></p>\r\n<p>\r\n	<span style=\"font-size:20px;\"><strong>На акционные товары скидка не распространяется! Будьте внимательны!</strong></span></p>\r\n<p>\r\n	&nbsp;</p>\r\n',1,'2019-11-21 02:25:58',3,66,'скидки, фейерверки, минск, беларусь, бонус, купить','','Сертификаты на фейерверки в нашем магазине piro.by',''),(80,'news','Новости  ','<h1>\r\n	Наши новости</h1>\r\n',1,'2019-11-21 14:15:42',4,66,'','','Новости магазина фейерверков piro.by',''),(81,'adres','Адрес магазина ','<p>\r\n<!--<p style=\"margin-left: 30px;\">\r\n	<span style=\"font-size:22px;\">Адрес магазина: метро Уручье, ул. Руссиянова 4, через дорогу от макдональдса.</span></p>\r\n<p>\r\n	<span style=\"font-size:20px;\">&nbsp; &nbsp; &nbsp;Телефон магазина +375(29)115-03-40 - Velcom</span></p>\r\n<p>\r\n	<span style=\"font-size:22px;\">&nbsp; &nbsp; &nbsp;Время работы с 11 00 до 20 00</span></p>\r\n<p style=\"margin-left: 30px;\">\r\n	<span style=\"font-size:20px;\">Узнавайте наличие выбраного товара перед тем как ехать!!!</span></p>\r\n<p style=\"margin-left: 30px;\">\r\n	<span style=\"font-size: 16px;\"><img alt=\"\" src=\"/media/images/карта.jpg\" style=\"width: 500px; height: 522px;\" /></span></p>--></p>\r\n',1,'2019-11-21 02:30:59',2,66,'','','Адреса магазинов фейерверков piro.by','<p>\r\n	Адрес магазина фейерверков в Минске piro.by</p>\r\n<p>\r\n	Наш магазин фейерверков расположен по адресу г. Минск, ул.</p>\r\n'),(83,'swadba','Свадебный салют','<h1>\r\n	Организация и проведение свадебного фейерверка</h1>\r\n',0,'2019-11-21 02:23:16',11,66,'','','Купить в Минске салют фейерверк на свадьбу - piro.by','');

